// src/components/About/About.js
import React from 'react';

const About = () => {
  return (
    <section className="p-8 bg-white text-center">
      <h3 className="text-2xl font-semibold mb-6">About LinkClick</h3>
      <p className="text-gray-700 max-w-2xl mx-auto">
        LinkClick is designed for people who struggle with technology. Whether you're a senior citizen or someone new to the internet, our goal is to make digital access easy, friendly, and empowering.
      </p>
    </section>
  );
};

export default About;
